import styles from "./OrderItem.module.css";

const OrderItem = (props) => {
  return (
    <div className={styles.divided}>
      <div className={styles.item}>
        <h3>{props.name}</h3>
        <div>{props.description}</div>
        <div>$ {props.price}</div>
      </div>
    </div>
  );
};

export default OrderItem;
